function reverseBits(n) {
  let rev = 0;

  // traversing bits of 'n'
  // from the right
  while (n > 0) {
    // bitwise left shift 'rev' by 1
    rev <<= 1;

    // if current bit is '1'
    if ((n & 1) == 1) rev ^= 1;

    // bitwise right shift 'n' by 1
    n >>= 1;
  }

  // required number
  return rev;
}

function isKthBitSet(x, k) {
  let rslt = (x & (1 << (k - 1))) != 0 ? 1 : 0;
  return rslt;
}

// This function returns true if binary
// representation of x is palindrome.
// For example (1000...001) is palindrome
function isPalindrome(n) {
  // get the number by reversing
  // bits in the  binary
  // representation of 'n'
  let rev = reverseBits(n);

  return n == rev;
}

async function main(arr) {
  const finalRes = [];
  // for (let i = 0; i < arr.length; i++) {
  while(arr.length > 0) {
    const element = arr[i];
    if (isPalindrome(element)) {
      finalRes.push(0);
    } else {
      checkPalindrome(element, 1, function(res) {
        finalRes.push(res);
      });
    }
  }
  console.log('Final ' , finalRes);
}

const checkPalindrome = function (n, count, cb) {
  
// console.log(n-count);
  //base case
  if((n-count) === 0) {
    return cb(0);
  }
  
  // recursive case
  if (isPalindrome(n - count)) {
    console.log(n-count);
    return cb(count);
  }
  if (isPalindrome(n + count)) {
    console.log(n+count);
    return cb(count);
  }
  count++;

  process.nextTick(() => {
    checkPalindrome(n, count, cb)
});
}
